    private void btnSiguiente2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_btnSiguiente2ActionPerformed
        // TODO add your handling code here:

        if (FormularioSercotecDos.rbtFemenino.isSelected() == false && FormularioSercotecDos.rbtMasculino.isSelected() == false) {

            JOptionPane.showMessageDialog(null, "Debe seleccionar el GENERO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtLugarNacimiento.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo LUGAR DE NACIMIENTO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboNivelEducacional.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar un NIVEL EDUCACIONAL valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboEtniaIndigena.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una ETNIA INDIGENA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.rbtDiscapacidadSi.isSelected() == false && FormularioSercotecDos.rbtDiscapacidadNo.isSelected() == false) {

            JOptionPane.showMessageDialog(null, "Debe seleccionar si posee o no DISCAPACIDAD", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.rbtDiscSi.isSelected() == false && FormularioSercotecDos.rbtDiscNo.isSelected() == false) {

            JOptionPane.showMessageDialog(null, "Debe seleccionar si posee o no CREDENCIAL", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.rbtDiscapacidadNo.isSelected() == true && FormularioSercotecDos.rbtDiscSi.isSelected() == true) {

            JOptionPane.showMessageDialog(null, "No puedes poseer credencial si no tienes discapacidad", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.rbtJefaturaHogarSi.isSelected() == false && FormularioSercotecDos.rbtJefaturaHogarNo.isSelected() == false) {

            JOptionPane.showMessageDialog(null, "Debe seleccionar si posee o no JEFATURA DE HOGAR", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboEstadoCivil.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar un ESTADO CIVIL valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtTelefonoFijo2.getText().length() > 9) {

            JOptionPane.showMessageDialog(null, "Debe ingresar un TELEFONO valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboRegionParticular.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una REGION valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboComunaParticular.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una COMUNA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.rbtPersonaNatural.isSelected() == false && FormularioSercotecDos.rbtPersonaJuridica.isSelected() == false) {

            JOptionPane.showMessageDialog(null, "Debe seleccionar PERSONA juridica o natural ", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtNivelVentasAnual.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo NIVEL DE VENTAS ANUAL", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtRutEmpresa.getText().trim().isEmpty()
                || FormularioSercotecDos.txtRutEmpresa.getText().length() > 9
                || FormularioSercotecDos.txtRutEmpresa.getText().length() < 9) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo RUT EMPRESA \n Debe ingresar un RUT EMPRESA valido", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtNombreEmpresa.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo NOMBRE EMPRESA", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboRegionEmpresa.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una REGION EMPRESA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboProvinciaEmpresa.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una PROVINCIA EMPRESA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboComunaEmpresa.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una COMUNA EMPRESA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.cboLocalidadEmpresa.getSelectedItem().toString() == "-Seleccione-") {

            JOptionPane.showMessageDialog(null, "Debe seleccionar una LOCALIDAD EMPRESA valida", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtDireccionEmpresa.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo DIRECCION EMPRESA", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtCorreoInterno.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo CORREO INTERNO", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtClaveInterno.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo CLAVE INTERNA", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtUsuarioSercotec.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo USUARIO SERCOTEC", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else if (FormularioSercotecDos.txtClaveSercotec.getText().trim().isEmpty()) {

            JOptionPane.showMessageDialog(null, "Debe completar el campo CLAVE SERCOTEC", "ERROR", JOptionPane.WARNING_MESSAGE);

        } else {

            //FormularioSercotecTres abrir = new FormularioSercotecTres();
            //abrir.setVisible(true);
            

            Proyecto proy = new Proyecto();

            proy.setFechaEntregaProyectoEstimada(FormularioSercotec.ftfFechaEntregaProyectoEstimada.getText());
            proy.setPersonaContactoProyecto(FormularioSercotec.txtPersonaContactoProyecto.getText());
            proy.setDescripcionProyecto(FormularioSercotec.txaDescripcionProyecto.getText());
            proy.setNombreProyecto(FormularioSercotec.txtNombreProyecto2.getText());

            Region reg = new Region();

            reg.setNombreRegion(FormularioSercotecDos.cboRegionParticular.getSelectedItem().toString());
            reg.setNombreRegionEmp(FormularioSercotecDos.cboRegionEmpresa.getSelectedItem().toString());

            Provincia prov = new Provincia();

            prov.setNombreProvincia(FormularioSercotec.cboProvincia.getSelectedItem().toString());
            prov.setNombreProvinciaEmp(FormularioSercotecDos.cboProvinciaEmpresa.getSelectedItem().toString());

            Comuna com = new Comuna();

            com.setNombreComuna(FormularioSercotecDos.cboComunaParticular.getSelectedItem().toString());
            com.setNombreComunaEmp(FormularioSercotecDos.cboComunaEmpresa.getSelectedItem().toString());

            Localidad loc = new Localidad();

            loc.setNombreLocalidad(FormularioSercotec.cboLocalidad.getSelectedItem().toString());
            loc.setNombreLocalidadEmp(FormularioSercotecDos.cboLocalidadEmpresa.getSelectedItem().toString());

            Nacimiento nac = new Nacimiento();

            nac.setLugarNacimiento(FormularioSercotecDos.txtLugarNacimiento.getText());
            nac.setFechaNacimiento(FormularioSercotecDos.ftfFechaNacimiento.getText());
            if (FormularioSercotecDos.rbtMasculino.isSelected() == true) {
                nac.setGenero("Masculino");
            } else if (FormularioSercotecDos.rbtFemenino.isSelected() == true) {

                nac.setGenero("Femenino");
            }

            UsoInterno ui = new UsoInterno();

            ui.setCorreo(FormularioSercotecDos.txtCorreoInterno.getText());
            ui.setClave(FormularioSercotecDos.txtClaveInterno.getText());
            ui.setUsuarioSercotec(FormularioSercotecDos.txtUsuarioSercotec.getText());
            ui.setClaveSercotec(FormularioSercotecDos.txtClaveSercotec.getText());

            Direccion dir = new Direccion();

            dir.setDireccion(FormularioSercotec.txtDireccionPersona.getText());
            dir.setDireccionEmp(FormularioSercotecDos.txtDireccionEmpresa.getText());

            Discapacidad d = new Discapacidad();

            if (FormularioSercotecDos.rbtDiscapacidadSi.isSelected() == true) {

                d.setSituacionDiscapacidad("Poseo discapacidad");

            } else if (FormularioSercotecDos.rbtDiscapacidadNo.isSelected() == true) {

                d.setSituacionDiscapacidad("NO poseo discapacidad");

            }
            if (FormularioSercotecDos.rbtDiscSi.isSelected() == true) {

                d.setCredencialDiscapacidad("Si");

            } else if (FormularioSercotecDos.rbtDiscNo.isSelected() == true) {

                d.setCredencialDiscapacidad("No");

            }

            DatosContacto dc = new DatosContacto();

            dc.setEmail(FormularioSercotec.txtEmail.getText());
            dc.setEmailAlternativo(FormularioSercotec.txtEmailAlter.getText());
            dc.setCelular(FormularioSercotecDos.txtCelular.getText());
            dc.setTelefono(FormularioSercotec.txtCelular.getText());

            Empresa emp = new Empresa();

            if (FormularioSercotecDos.rbtPersonaJuridica.isSelected() == true) {

                emp.setTipoPersona("Juridica");

            } else if (FormularioSercotecDos.rbtPersonaNatural.isSelected() == true) {

                emp.setTipoPersona("Natural");

            }

            emp.setNumeroTrabajadoresContrato(Integer.parseInt(FormularioSercotecDos.spnNumTrabajadoresContrato.getValue().toString()));
            emp.setNivelVentasAnual(Integer.parseInt(FormularioSercotecDos.txtNivelVentasAnual.getText()));
            emp.setRutEmpresa(Integer.parseInt(FormularioSercotecDos.txtRutEmpresa.getText()));
            emp.setNombreEmpresa(FormularioSercotecDos.txtNombreEmpresa.getText());

            Persona p = new Persona();

            //name = FormularioSercotec.txtNombres.getText();
            p.setRut(Integer.parseInt(FormularioSercotec.txtRut.getText()));
            p.setNombres(FormularioSercotec.txtNombres.getText());
            p.setApellidoPaterno(FormularioSercotec.txtApellidoPat.getText());
            p.setApellidoMaterno(FormularioSercotec.txtApellidoMat.getText());
            p.setConcurso(FormularioSercotec.txtConcurso.getText());
            p.setHorarioVideo(FormularioSercotec.ftfHorarioVideo.getText());
            p.setNivelEducacional(FormularioSercotecDos.cboNivelEducacional.getSelectedItem().toString());
            p.setEtniaIndigena(FormularioSercotecDos.cboEtniaIndigena.getSelectedItem().toString());

            if (FormularioSercotecDos.rbtJefaturaHogarSi.isSelected() == true) {

                p.setJefeHogar("Si");

            } else if (FormularioSercotecDos.rbtJefaturaHogarNo.isSelected() == true) {

                p.setJefeHogar("No");
            }

            p.setPersonasDependiente(Integer.parseInt(FormularioSercotecDos.spnPersonasDependientes.getValue().toString()));
            p.setEstadoCivil(FormularioSercotecDos.cboEstadoCivil.getSelectedItem().toString());

            FichaTec fichaTec = new FichaTec();

            fichaTec.setNombreProy(FormularioSercotec.txtNombreProyecto2.getText());
            fichaTec.setDescripcionProy(FormularioSercotec.txaDescripcionProyecto.getText());

            Corporacion corp = new Corporacion();

            corp.setNombreCorporacion("Sercotec");

            PersonaDAO perDAO = new PersonaDAO();
            DatosContactoDAO dcDAO = new DatosContactoDAO();
            DiscapacidadDAO diDAO = new DiscapacidadDAO();
            DireccionDAO dDAO = new DireccionDAO();
            UsoInternoDAO uiDAO = new UsoInternoDAO();
            NacimientoDAO nDAO = new NacimientoDAO();
            ProvinciaDAO pDAO = new ProvinciaDAO();
            ComunaDAO cDAO = new ComunaDAO();
            LocalidadDAO lDAO = new LocalidadDAO();
            RegionDAO rDAO = new RegionDAO();
            ProyectoDAO proyDAO = new ProyectoDAO();
            FichaTecDAO fichaTecDAO = new FichaTecDAO();
            CorporacionDAO corpDAO = new CorporacionDAO();
            EmpresaDAO empDAO = new EmpresaDAO();

            try {

                if (rDAO.consultaDatos(reg, prov)) {

                    System.out.println("Region agregada");

                    if (pDAO.consultaDatos(prov, com)) {

                        System.out.println("Provincia agregada");

                        if (cDAO.consultaDatos(com, loc)) {

                            System.out.println("Comuna agregada");

                            if (lDAO.consultaDatos(loc, dir)) {

                                System.out.println("Localidad persona agregada");

                                if (lDAO.consultaDatosEmp(loc, dir)) {

                                    System.out.println("Localidad empresa agregada");

                                    if (dDAO.consultaDatos(dir, p, emp)) {

                                        System.out.println("Direccion persona y empresa agregada");

                                        if (dcDAO.consultaDatos(dc, p)) {

                                            System.out.println("Datos contacto agregada");

                                            if (diDAO.consultaDatos(d, p)) {

                                                System.out.println("Discapacidad agregada");

                                                if (uiDAO.consultaDatos(ui, p)) {

                                                    System.out.println("Uso interno agregada");

                                                    if (nDAO.consultaDatos(nac, p)) {

                                                        System.out.println("Nacimiento agregada");

                                                        if (corpDAO.consultaDatos(corp, p)) {

                                                            System.out.println("Corporacion agregada");

                                                            if (perDAO.consultaDatos(p, emp, proy, fichaTec)) {

                                                                System.out.println("Persona agregada");

                                                                if (proyDAO.consultaDatos(proy)) {

                                                                    System.out.println("Proyecto agregada");

                                                                    if (fichaTecDAO.consultaDatos(fichaTec)) {

                                                                        System.out.println("Ficha tecnica agregada");

                                                                        if (empDAO.consultaDatos(emp)) {
                                                                            
                                                                            System.out.println("Empresa agregada");

                                                                            JOptionPane.showMessageDialog(null, "DATOS AGREGADOS CORRECTAMENTE! \n"
                                                                                    + "Puede cerrar las demas pestañas y \n"
                                                                                    + "y agregar mas personas \n"
                                                                                    + "RECUERDE SU ID!!! \n"
                                                                                    + "Su ID es: " + proy.getIdPersonaF());

                                                                            this.dispose();
                                                                            
                                                                            SeleccionProyecto cerrar = new SeleccionProyecto();
                                                                            cerrar.setVisible(false);
                                                                            
                                                                            Login abrir = new Login();
                                                                            abrir.setVisible(true);

                                                                        }
                                                                    }

                                                                }

                                                            }

                                                        }

                                                    }

                                                }

                                            }

                                        }

                                    }

                                }

                            }

                        }
                    }

                }

            } catch (Exception e) {
                
                JOptionPane.showMessageDialog(this, e.getMessage());
            }

        }

    }//GEN-LAST:event_btnSiguiente2ActionPerformed

    private void txtTelefonoFijo2KeyTyped(java.awt.event.KeyEvent evt) {//GEN-FIRST:event_txtTelefonoFijo2KeyTyped
        char validar = evt.getKeyChar();

        if (Character.isLetter(validar)) {

            getToolkit().beep();
            evt.consume();

            JOptionPane.showMessageDialog(null, "Ingresar solo numeros");

        }
    }//GEN-LAST:event_txtTelefonoFijo2KeyTyped

